import React from "react";
import "./index.css";
import { Switch, Route, Redirect } from "react-router-dom";
import Board from "./components/Board";
import Home from "./pages/Home";
import SignIn from "./pages/SignIn";
import Intro1 from "./pages/Intro1";
import Intro2 from "./pages/Intro2";
import Intro3 from "./pages/Intro3";
import Intro4 from "./pages/Intro4";
import WhatsurName from "./pages/WhatsUrName";
import SignUp from "./pages/SignUp";
import Menu from "./pages/Menu";
import Game from "./pages/Game";
import Result from "./pages/Result";
import LeaderBoard from "./pages/LeaderBoard";
import Instructions from "./pages/Instructions";
import DinoPicker from "./pages/DinoPicker";

function App() {
  return (
    <div>
      <Switch>
        <Redirect exact from="/" to="/home" />
        <Route path="/home" component={Home} />
        <Route path="/sign-in" component={SignIn} />
        <Route path="/intro-1" component={Intro1} />
        <Route path="/intro-2" component={Intro2} />
        <Route path="/intro-3" component={Intro3} />
        <Route path="/intro-4" component={Intro4} />
        <Route path="/whats-ur-name" component={WhatsurName} />
        <Route path="/sign-up" component={SignUp} />
        <Route path="/menu" component={Menu} />
        <Route path="/dino-picker" component={DinoPicker} />
        <Route path="/game" component={Game} />
        <Route path="/result" component={Result} />
        <Route path="/leader-board" component={LeaderBoard} />
        <Route path="/instructions" component={Instructions} />
      </Switch>
    </div>
  );
}

export default App;
